        self::$entity->delete(self::$entityName);
    }

    public function testAddPoint()
    {
        self::$track->addPoint(
            entity_name: self::$entityName,
            latitude: 31.830137,
            longitude: 117.133156,
            loc_time: 1736165711,
            speed: 10.7601,
            direction: 104.27,
            coord_type_input: 'wgs84',
        );

        $this->assertTrue(true);
    }

