    public function testGetLatestPoint()
    {
        $res = self::$track->getLatestPoint(
            entity_name: self::$entityName
        );

        $this->assertEquals(0, $res['status']);
        $this->assertIsArray($res['latest_point']);
    }

    public function testGetDistance()
    {
        $res = self::$track->getDistance(
            entity_name: self::$entityName,
            start_time: 1736220695,
            end_time: 1736222695,
            is_processed: true
        );

        $this->assertEquals(0, $res['status']);
    }

    public function testGetTrack()
    {
        $res = self::$track->getTrack(
            entity_name: self::$entityName,
            start_time: 1736220695,
            end_time: 1736222695,
            is_processed: true
        );

        $this->assertEquals(0, $res['status']);
    }
